          "id": "501dd391aed6fe6bdec1a2baeba114489604f153",
          "message": "fix(deps): update rust crate redis to 0.27 (#294)\n\nThis PR contains the following updates:\r\n\r\n| Package | Type | Update | Change |\r\n|---|---|---|---|\r\n| [redis](https://redirect.github.com/redis-rs/redis-rs) | dependencies\r\n| minor | `0.26` -> `0.27` |\r\n\r\n---\r\n\r\n### Release Notes\r\n\r\n<details>\r\n<summary>redis-rs/redis-rs (redis)</summary>\r\n\r\n###\r\n[`v0.27.0`](https://redirect.github.com/redis-rs/redis-rs/releases/tag/redis-0.27.0)\r\n\r\n[Compare\r\nSource](https://redirect.github.com/redis-rs/redis-rs/compare/redis-0.26.1...redis-0.27.0)\r\n\r\n##### Features\r\n\r\n- Add r2d2 support for SentinelClient\r\n([#&#8203;1297](https://redirect.github.com/redis-rs/redis-rs/pull/1297)\r\n[@&#8203;smf8](https://redirect.github.com/smf8))\r\n- Xinfo groups lag and entries-read support\r\n([#&#8203;837](https://redirect.github.com/redis-rs/redis-rs/pull/837)\r\n[@&#8203;massimiliano-mantione](https://redirect.github.com/massimiliano-mantione))\r\n- Improve cluster documentation.\r\n[#&#8203;1263](https://redirect.github.com/redis-rs/redis-rs/pull/1263)\r\n- Allow splitting async PubSub to Sink & Stream.\r\n[#&#8203;1144](https://redirect.github.com/redis-rs/redis-rs/pull/1144)\r\n- Default for ConnectionManagerConfig\r\n([#&#8203;1308](https://redirect.github.com/redis-rs/redis-rs/pull/1308)\r\n[@&#8203;feelingsonice](https://redirect.github.com/feelingsonice))\r\n- Abort backing task to multiplexed connection on drop\r\n([#&#8203;1264](https://redirect.github.com/redis-rs/redis-rs/pull/1264))\r\n\r\n##### Changes & Bug fixes\r\n\r\n- Fix new lints\r\n[#&#8203;1310](https://redirect.github.com/redis-rs/redis-rs/pull/1310)\r\n- Use pipelines to setup connections\r\n[#&#8203;1250](https://redirect.github.com/redis-rs/redis-rs/pull/1250)\r\n- Bump MSRV to 1.70\r\n[#&#8203;1286](https://redirect.github.com/redis-rs/redis-rs/pull/1286)\r\n\r\n#### New Contributors\r\n\r\n-\r\n[@&#8203;massimiliano-mantione](https://redirect.github.com/massimiliano-mantione)\r\nmade their first contribution in\r\n[https://github.com/redis-rs/redis-rs/pull/837](https://redirect.github.com/redis-rs/redis-rs/pull/837)\r\n- [@&#8203;feelingsonice](https://redirect.github.com/feelingsonice)\r\nmade their first contribution in\r\n[https://github.com/redis-rs/redis-rs/pull/1308](https://redirect.github.com/redis-rs/redis-rs/pull/1308)\r\n\r\n**Full Changelog**:\r\nhttps://github.com/redis-rs/redis-rs/compare/redis-0.26.1...redis-0.27.0\r\n\r\n</details>\r\n\r\n---\r\n\r\n### Configuration\r\n\r\nðŸ“… **Schedule**: Branch creation - At any time (no schedule defined),\r\nAutomerge - At any time (no schedule defined).\r\n\r\nðŸš¦ **Automerge**: Disabled by config. Please merge this manually once you\r\nare satisfied.\r\n\r\nâ™» **Rebasing**: Whenever PR becomes conflicted, or you tick the\r\nrebase/retry checkbox.\r\n\r\nðŸ”• **Ignore**: Close this PR and you won't be reminded about this update\r\nagain.\r\n\r\n---\r\n\r\n- [ ] <!-- rebase-check -->If you want to rebase/retry this PR, check\r\nthis box\r\n\r\n---\r\n\r\nThis PR was generated by [Mend Renovate](https://mend.io/renovate/).\r\nView the [repository job\r\nlog](https://developer.mend.io/github/bosun-ai/swiftide).\r\n\r\n<!--renovate-debug:eyJjcmVhdGVkSW5WZXIiOiIzOC43NC4xIiwidXBkYXRlZEluVmVyIjoiMzguNzQuMSIsInRhcmdldEJyYW5jaCI6Im1hc3RlciIsImxhYmVscyI6W119-->\r\n\r\nCo-authored-by: renovate[bot] <29139614+renovate[bot]@users.noreply.github.com>",
